import { FC, InputHTMLAttributes, useState } from "react";
import style from './Home.module.scss';
import kittenHeader from '../';

const Home: FC = () => {
    const [user, setUser] = useState('');
    const handleOnChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        setUser(event.target.value)
    };

    return (
        <div className={style.home}>
            <div className={style.header}>
                <img className={style.imgGit} src="https://doctor-veterinar.ru/media/k2/items/cache/675d28c04794e3c683f4419536c4c15f_L.jpg" alt="icon" />
                <form action="#" className={style.search}>
                    <button type="submit" className={style.btn}>
                        <img className={style.img} src="https://img1.freepng.ru/20191016/wv/transparent-fit-icon-glass-icon-search-icon-5da819afa508b0.137666551571297711676.jpg" alt="foto" />
                    </button>
                    <input onChange={handleOnChange} className={style.inputHeader} type="text" placeholder="Enter GitHub username"/>
                </form>     
            </div>
            <div className={style.main}>
                <img className={style.searchBig} src="https://cdn-icons-png.flaticon.com/512/751/751463.png" alt="ICON"  />
                <h2 className={style.title}>Start with searching a GitHub user</h2>
            </div>
        </div>
    );
};
export default Home;
